Greek:
Προειδοποίηση: Εάν απενεργοποιήσεις την μη ολοκληρωμένη αποστολή φατρίας
'{0}' θα χάσεις οποιαδήποτε πρόοδο έχεις κάνει.

Θες να την απενεργοποιήσεις όπως και να έχει;

Προειδοποίηση: Αν τερματίσεις το παιχνίδι, ενώ η αποστολή φατριών '{0}' είναι ενεργή, 
 θα χάσεις όλη την πρόοδο.

Παρακαλώ;

Συνιστάται να δημιουργήσεις ένα αντίγραφο ασφαλείας πριν συμπιέσεις το αποθηκευμένο παιχνίδι.
ΣΗΜΕΙΩΣΗ: Η συμπίεση μπορεί να διαρκέσει μερικά λεπτά - ειδικά αν εργάζεσαι σε έναν μαγνητικό σκληρό δίσκο.

Εφαρμογή συμπίεσης τώρα;

ΣΗΜΕΙΩΣΕ ΌΤΙ: Εάν παραλήψεις ένα κεφάλαιο, θα πάρεις τα αντικείμενα που ούτως ή αλλιώς θα έπαιρνες παίζοντάς το.
Δεν μπορείς να παίξεις αυτό το κεφάλαιο οποιαδήποτε στιγμή αργότερα.

Θες πραγματικά το παραλήψεις;
